- cont_Halloween:
    Control: GroupContainer@1.3.0
    Variant: ManualLayout
    Properties:
      Height: =Parent.Height
      Width: =Parent.Width
    Children:
      - img_fond:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 18, 107, 1)
            Fill: =Color.Black
            Height: =Parent.Height
            Image: ="https://png.pngtree.com/background/20230618/original/pngtree-halloween-picture-image_3712631.jpg"
            ImagePosition: =ImagePosition.Fill
            Width: =Parent.Width
      - img_logo_powerapps:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 0, 0, 0)
            BorderStyle: =BorderStyle.None
            BorderThickness: =2
            DisabledBorderColor: =RGBA(0, 0, 0, 0)
            DisabledFill: =RGBA(0, 0, 0, 0)
            FocusedBorderThickness: =4
            HoverBorderColor: =RGBA(0, 0, 0, 0)
            HoverFill: =RGBA(0, 0, 0, 0)
            Image: ="https://store-images.s-microsoft.com/image/apps.5460.13795821674373682.42a749e2-3ed9-43c6-88ec-0045278b4e49.7c939c07-5097-4a52-abd1-de0a42b889ba"
            PressedBorderColor: =RGBA(0, 0, 0, 0)
            PressedFill: =RGBA(0, 0, 0, 0)
            X: =32
            Y: =24
      - img_text_Halloween:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 18, 107, 1)
            Height: =Parent.Height
            Image: "=\"data:image/svg+xml;utf8,\" & \r\nEncodeUrl(\r\n    \"<svg width='\"&Self.Width&\"' height='\"&Self.Height&\"' xmlns='http://www.w3.org/2000/svg'>\r\n  <defs>\r\n\r\n\r\n\r\n\r\n    <style type='text/css'>\r\n      @font-face {\r\n    font-family: 'Halloween';\r\n    src: url(data:application/font-woff;base64,) format('woff');\r\n    font-weight: normal;\r\n    font-style: normal;\r\n}\r\n      .pixel {\r\n        font-family: 'Halloween';\r\n        \r\n\r\n      }\r\n    </style>\r\n  </defs>\r\n  \r\n  <text x='\"&(50+If(IsBlank(varDecallage),0,varDecallage))&\"%' y='\"&(50+If(IsBlank(varDecallage),0,varDecallage))&\"%'\r\n    text-anchor='middle'\r\n    dominant-baseline='middle'\r\n    font-size='\"&If(IsBlank(lst_size.Selected.Value),60,lst_size.Selected.Value)&\"'\r\n    fill='\"&If(IsBlank(varColor),\"#FF7518\",varColor)&\"'\r\n    class ='pixel'\r\n>\r\n\r\n\r\n\r\n    \"&inp_text.Value &\"\r\n\r\n\r\n  </text>\r\n  \r\n</svg>\"\r\n)"
            ImagePosition: =ImagePosition.Center
            Width: =Parent.Width
      - tim_color:
          Control: Timer@2.1.0
          Properties:
            AutoStart: =varAnimation<>false
            BorderColor: =ColorFade(Self.Fill, -15%)
            Color: =RGBA(255, 255, 255, 1)
            DisabledBorderColor: =ColorFade(Self.BorderColor, 70%)
            DisabledColor: =ColorFade(Self.Fill, 90%)
            DisabledFill: =ColorFade(Self.Fill, 70%)
            Duration: =50
            Fill: =RGBA(56, 96, 178, 1)
            Font: =Font.'Open Sans'
            HoverBorderColor: =ColorFade(Self.BorderColor, 20%)
            HoverColor: =RGBA(255, 255, 255, 1)
            HoverFill: =ColorFade(RGBA(56, 96, 178, 1), -20%)
            OnTimerStart: |-
              =If(IsBlank(varNoColor), UpdateContext({varNoColor : 0}));UpdateContext({varNoColor:varNoColor+1});Switch(varNoColor,1,UpdateContext({varColor :"#FFA64D"}),2,UpdateContext({varColor :"#FF8000"}),3,UpdateContext({varColor :"#FF7514"}),4,UpdateContext({varColor :"#FF9900"}),UpdateContext({varColor :"#E67300",varNoColor:0}));
              UpdateContext({varDecallage : Switch(varNoColor,1,0,2,1,3,0,4,1)})
            PressedBorderColor: =Self.Fill
            PressedColor: =Self.Fill
            PressedFill: =Self.Color
            Repeat: =true
            Start: =varAnimation<>false
            Visible: =false
            X: =40
            Y: =40
      - img_citrouille:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 18, 107, 1)
            Height: =155
            Image: |-
              ="data:image/svg+xml;utf8," & EncodeUrl(
                  "<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 64 64'>" &
                  "<ellipse cx='32' cy='32' rx='28' ry='24' fill='#ff8000' stroke='#000' stroke-width='2'/>" &
                  "<path d='M20 26 Q22 20 26 26 Q30 32 34 26 Q38 20 42 26' fill='#000'/>" &
                  "<path d='M24 40 Q32 48 40 40 Q32 44 24 40' fill='#000'/>" &
                  "<rect x='30' y='8' width='4' height='12' fill='#663300'/>" &
                  "</svg>"
              )
            OnSelect: |-
              =UpdateContext({varAnimation : Not(varAnimation)})
            Width: =195
            X: =1140
            Y: =24
      - img_head:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 18, 107, 1)
            Height: =152
            Image: |-
              ="data:image/svg+xml;utf8," & EncodeUrl(
                  "<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 64 64'>" &
                  "<path d='M32 2c16 0 28 12 28 28s-12 28-28 28S4 46 4 30 16 2 32 2z' fill='#f2f2f2' stroke='#000' stroke-width='2'/>" &
                  "<circle cx='22' cy='26' r='5' fill='#000'/>" &
                  "<circle cx='42' cy='26' r='5' fill='#000'/>" &
                  "<path d='M24 40 Q32 50 40 40' stroke='#000' stroke-width='2' fill='none'/>" &
                  "<path d='M20 20 L24 24 M44 20 L40 24' stroke='#000' stroke-width='1'/>" &
                  "<path d='M32 2 L30 10 M32 2 L34 10' stroke='#000' stroke-width='1'/>" &
                  "</svg>"
              )
            OnSelect: =Select(img_citrouille)
            Width: =175
            X: =609
            Y: =565
      - img_toile:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 18, 107, 1)
            Height: =121
            Image: ="data:image/svg+xml;utf8,<svg xmlns='http://www.w3.org/2000/svg' width='200' height='200'><circle cx='100' cy='100' r='2' fill='white'/><line x1='100' y1='0' x2='100' y2='200' stroke='white' stroke-width='1'/><line x1='0' y1='100' x2='200' y2='100' stroke='white' stroke-width='1'/><line x1='30' y1='30' x2='170' y2='170' stroke='white' stroke-width='1'/><line x1='170' y1='30' x2='30' y2='170' stroke='white' stroke-width='1'/><circle cx='100' cy='100' r='20' stroke='white' stroke-width='1' fill='none'/><circle cx='100' cy='100' r='40' stroke='white' stroke-width='1' fill='none'/><circle cx='100' cy='100' r='60' stroke='white' stroke-width='1' fill='none'/><circle cx='100' cy='100' r='80' stroke='white' stroke-width='1' fill='none'/></svg>"
            Width: =128
            Y: =228
      - img_spider:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 18, 107, 1)
            Height: =136
            Image: |-
              ="data:image/svg+xml;utf8," & EncodeUrl(
                "<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 64 64'>" &
                "<line x1='32' y1='0' x2='32' y2='20' stroke='white'/>" &
                "<circle cx='32' cy='32' r='8' fill='white'/>" &
                "<line x1='24' y1='28' x2='16' y2='24' stroke='white'/>" &
                "<line x1='24' y1='36' x2='16' y2='40' stroke='white'/>" &
                "<line x1='40' y1='28' x2='48' y2='24' stroke='white'/>" &
                "<line x1='40' y1='36' x2='48' y2='40' stroke='white'/>" &
                "</svg>"
              )
            Width: =151
            X: =989
            Y: =148
      - img_tombe:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 18, 107, 1)
            Height: =171
            Image: |-
              ="data:image/svg+xml;utf8," & EncodeUrl(
                "<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 64 64'>" &
                "<rect x='20' y='24' width='24' height='32' rx='6' fill='gray' stroke='black' stroke-width='2'/>" &
                "<text x='32' y='44' font-size='10' text-anchor='middle' fill='black'>RIP</text>" &
                "</svg>"
              )
            Width: =171
            X: =319
            Y: =446
      - logo_moca:
          Control: Image@2.2.3
          Properties:
            BorderColor: =RGBA(0, 18, 107, 1)
            Height: =60
            Image: ="https://www.asi.fr/sites/default/files/styles/og_image/public/2022-02/MOCA_byASI_Lancement_Marque.jpg?itok=cjcfTEkN"
            Width: =132
            Y: =Parent.Height-Self.Height
      - inp_text:
          Control: TextInput@0.0.54
          Properties:
            Fill: =RGBA(255,165,0,0.8)
            FontSize: =20
            FontWeight: =FontWeight.Bold
            Height: =57
            TriggerOutput: ="KeyPress"
            Value: ="Low-code, high fear. Happy Halloween!"
            Visible: =varAnimation=false
            Width: =433
            X: =16
            Y: =23
      - lst_size:
          Control: DropDown@0.0.45
          Properties:
            Appearance: ='DropdownCanvas.Appearance'.FilledDarker
            DefaultSelectedItems: =[60]
            Fill: =RGBA(255,165,0,0.8)
            FontSize: =20
            Height: =57
            Items: =Filter(Sequence(100),Value>40)
            Visible: =varAnimation=false
            Width: =311
            X: =457
            Y: =23
